import React from 'react';
import Burger from './Burger';
import './Navbar.css'

const Nav = styled.nav`
  width: 100%;
  height: 55px;
  border-bottom: 2px solid #f1f1f1;
  padding: 0 20px;
  display: flex;
  justify-content: space-between;

  .logo {
    padding: 15px 0;
  }
`

const Navbar = () => {
  return (
    <div className="navbar">
      <div className="logo">
      </div>
      <Burger />
    </div>
  )
}

export default Navbar
